svg.script:

document.querySelector(".sun").addEventListener("click", function() {
    let map = document.querySelector("#noise feDisplacementMap");
    let turbulence = document.querySelector("#noise feTurbulence");

    function step() {
        map.setAttribute("scale", Number(Math.random() * 20));
        turbulence.setAttribute("baseFrequency", `${Math.random() * 0.1} ${Math.random() * 1}`);
        window.requestAnimationFrame(step);
    }

    window.requestAnimationFrame(step);
});
